import React, { useState } from 'react';
import { FaBell, FaUser, FaCog, FaBars, FaShoppingCart } from 'react-icons/fa';
import './Navbar.css';

function Navbar() {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <div className="navbar">
      {/* Left: Logo + Menu */}
      <div className="navbar-left">
        <FaBars className="icon menu-icon" title="Menu" onClick={() => setMenuOpen(!menuOpen)} />
        <h2 className="logo-text">üçΩÔ∏è FoodieHub</h2>
      </div>

      {/* Center: Navigation Links (conditionally shown on mobile) */}
      <div className={`navbar-center ${menuOpen ? 'show-menu' : ''}`}>
        <a href="#home" className="nav-link">Home</a>
        <a href="#menu" className="nav-link">Menu</a>
        <a href="#about" className="nav-link">About</a>
        <a href="#contact" className="nav-link">Contact</a>
      </div>

      {/* Right: Book table button */}
      <div className="navbar-right">
        <button className="book-btn">Book Table</button>
      </div>
    </div>
  );
}

export default Navbar;
